import React from 'react';
import styled from 'styled-components';

const ChattingLogsBlock = styled.div`
  width: 100%;
  flex: 6;
`;
const Message = styled.div`
  border: 1px solid black;
`;
const Send = styled(Message)``;
const Receive = styled(Message)``;
const ChattingLogs = ({ logs }) => {
  return (
    <ChattingLogsBlock>
      {logs.map((message, idx) =>
        logs.type === 'send' ? (
          <Send key={idx}>{message.message}</Send>
        ) : (
          <Receive key={idx}>{message.message}</Receive>
        ),
      )}
    </ChattingLogsBlock>
  );
};

export default ChattingLogs;
